import React from "react";

/*<ContactPicker contacts={contacts} id='contact' name='contact' value={contact} onChange={(e) => setContact(e.target.value)} />*/

export const ContactPicker = ({contacts, setContact, value, name}) => {
  return (
    <>
      <select name={name} value={value} onChange={(e) => setContact(e.target.value)}>
        <option value="">No Contact Selected</option>
        {contacts.map((item) => {
  return (
    <option value={item.name}>{item.name}</option>
  );
})};
      </select>
    </>
  );
};
